B.bB=new A.bg(B.D7,["I'm Frasier's brother.","D'oh!","Do you remember me? Or are you a goldfish?","I'm the White House press secretary.","The nerds across the hall think I'm hot.","Grab your gear.","They could have called the show 'How I Met [This Person].","Oh, Rob!","Gee, Beav. You're goofy.","When did I go from being Dr. Bartlett to Mrs. Bartlett?","Oscar and I were BFF's.","I'm the nurse on Emergency.","I lived in Mayberry until I joined the Marines.","This was my nickname in Congress until I became vice-president.","Hey there, Normie! See you in the next Pixar movie! (also ___ Calley on W. Wing)","I'm a crappy surgeon, but I know it's nice to be nice to the nice.","You probably know my son Frasier.","I worked with Agent 99.","Perhaps you could join me for a burger, or some such.","The Man from [Me] worked with the young Ducky (Ilya Kuryakin).","I work for The Independent.","Rude personality, but I was a good doctor.","Dr. Steve Kiley and I saved a lot of lives.","There was a whole Bunch of us.","Simpson, eh? ... Ex-cellent!","Ross knows how to get a couch up a stairway.","Ah, Dr. Palmer, this reminds me of a previous case ...","Felix and I were BFF's.","The city that made white suits, turquoise t-shirts, and Phil Collins music popular in the 1980's.","___ and ___, 1980's TV show about two brothers running a detective agency.","You never saw me, except as a hatrack, but I was married to Niles.","I'm The Rifleman, ___ McCain.","I was commander of the 4077th until they killed me.","Live long and prosper.","Pat Sajak spun me for 40 years.","Homer and I have been together forever, despite my big blue hair.","She started as Josh Lyman's assistant, but by the end of The West Wing she was running a campaign.","George, Elaine, and Kramer seem to always be in his apartment in this show about nothing.","Do you want to be a millionaire? I was, having been a daytime TV fixture for many decads.","My voice was shrill, but Archie loved me.","If Lucy's in trouble, you'll find me at the Copa.","Niles, Frasier, and Marty","Choppers! Wait for it!","How I Met Your Mother's Ted ___","In the 1970's, Dick Van Patten said ___ is Enough.","Sarcastic waitress from Cheers","I hated Chuck, by the end of the series I respected him; aka Alexander Coburn.","I'm Frasier's producer.","I'm a pimp for high end prostitutes, and I helped Gibbs a couple times.","Ed Asnwer played me in two TV series, Lou ___.","Before Golden Girls, Bea Arthur played this title character in the popular 1970's TV series.","___ and the Man, one of the first American TV series starring a Latino character.","Straight person to Robin Williams' Mork","___ Gianelli, helps with Bartlett's campaign.","Character married to Bob Hartley in the Bob Newhart Show.","I'm Marty's dog.","Nickname George called his wife Louise, after they moved on up from the east side to a deluxe apartment in the sky.","___ and Sally were comedy writers on the Dick Van Dyke Show.","Character who starred in The Honeymooners, with his friend Norton and wife Alice.","It's the T in Mary T Moore","I ratted out Chuck. He didn't know it, but I was saving him.","Rachel from Friends","Chambers from Cheers","Kramer's first name; master of his domain.","She and Fred were the Ricardo's friends and landlords.","___ Mason never lost a case.","Thurston Howell's spouse (or the last coach to take the Bears to the Super Bowl).","If you're 60, I was the Enterprise's doctor. If you're 40, I'm a forensic scientist.","Her character was in the first season of The West Wing, but never really clicked.","Charlie ___; I was Pres. Bartlett's 'body man', before starring in Psych.","If you're 50, she was C. J. Cregg's assistant. If you're 65, she's the comedienne who had a successful variety show in the 1970's.","Stupid yet endearing bartender from Cheers","Hey guys? I know karate!","Which one's Ed and which one's him? ... It doesn't matter!","Assistant White House Counsel Ainsley ___, or the 19th President of the United States."],t.hD)
